'use strict';

/**
 * @ngdoc overview
 * @name ngappApp
 * @description
 * # ngappApp
 *
 * Main module of the application.
 */
angular
  .module('ngappApp', [
    'ngAnimate',
    'ngCookies',
    'ngMessages',
    'ngResource',
    'ngRoute',
    'ngSanitize'
  ])
  .config(function ($routeProvider) {
    $routeProvider
      .when('/', {
        templateUrl: 'views/main.html',
        controller: 'MainCtrl',
        controllerAs: 'main'
      })
      .when('/satisfaction', {
        controller: function ($scope, $interval, $log) {
          $scope.logBuffer = [];
          $interval(() => {
            $log.log('%o', $scope.logBuffer);
          }, 1000);
        },
        template: '<section id="satisfaction-test" satisfaction-slider satisfactionLogBuffer="satisfactionLogBuffer"></section>'
      })
      .otherwise({
        redirectTo: '/'
      });
  });
